import React from 'react';
import './App.css';

function Todo({ todo }) {
  return (
    <div className="todo">
      {todo.text}
    </div>
  );
};


function App() {

  const [todolist, setTodolist] = React.useState([
    { text: "Take Kids to School" },
    { text: "Attend Daily Scrum" },
    { text: "Have Lunch with Marketing Team" },
    { text: "New Tech Presentation" }
  ]);


  return (
    <div className="App">
      Todo App with Hooks
    </div>
  );
}

export default App;
